INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (104, 21268, 'Kava', 'The combination of kava and alcohol poses a theoretical risk of additive hepatotoxicity during chronic concomitant use.  Studies in mice also suggest that the hypnotic effects of kava and alcohol may be synergistically increased when taken together, and that alcohol can markedly potentiate the toxicity of kava.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
