INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (181, 6796, 'Levamisole', 'Case histories have suggested that levamisole is associated with some side effects (including headache, fever, shivers, and dizziness) that suggest an disulfiram-like interaction with alcohol.  These side effects could be alleviated by total abstinence from alcohol.  No mechanism has been established for this interaction.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'789c0b482cc94ccd2b2956284a4d4ecd2ccbcc4b57c8492d4bcccd2ccecf495528cec82fcd4951482ccbcf049239c9f919f9397a0002b61388', NULL, X'');
